import React, { useState } from 'react';
import '../App.css';

export default function Header() {
  return (
    <header>
      <h3>스타트 팜</h3>
      <ul className="menu">
        <li>귀농 한달살이</li>
        <li>농산물 펀딩</li>
        <li>클린 농촌마을</li>
      </ul>
      <p>귀농의 처음부터 끝까지!</p>
    </header>
  );
}
